/**
 * @name parsing
 * @author JungHyunKwon
 * @since 2017-12-06
 * @version 1.0.0
 * @param {string} value
 * @param {string} from
 * @param {string} to
 * @param {number} index
 * @return {string || array}
 */
try{!function(){"use strict";window.parsing=function(n,r,t,i){var e="";if("string"==typeof n){var f=n.indexOf(r,i);if(f>-1){var o=f+r.length,s=n.indexOf(t,o);s>-1&&(e=n.substring(o,s))}}return e},window.parsingAll=function(n,r,t){var i=[];if("string"==typeof n&&"string"==typeof r&&"string"==typeof t)for(var e=0,f=0,o=0;(e=n.indexOf(r,e))>-1;)o=e+r.length,(f=n.indexOf(t,o))>-1&&(i.push({value:n.substring(o,f),fromIndex:o,toIndex:f}),e=f+1);return i}}()}catch(n){console.error(n)}